import './App.css';
import ExpensesItem from './Components/ExpensesItem';

function App() {
  const Expense=[
    {name:"Car Insurance",amount:2000,date:new Date()},
    {name:"Movie",amount:800,date:new Date()},
    {name:"Swiggy",amount:500,date:new Date()}
   ];

  return (
    <div className="App">
      <ExpensesItem title={Expense[0].title} amount={Expense[0].amount} date={Expense[0].date}></ExpensesItem>

    </div>
  );
}

export default App;
